import React from 'react';

export const CreatePasswordComponent = ({ 
    password,
    setPassword,
    confirmPassword,
    setConfirmPassword,
    passwordPlaceholder,
    handlePasswordClick,
    handlePasswordBlur,
    confirmPlaceholder,
    handleConfirmClick,
    handleConfirmBlur,
    handleNextClick,
    passwordMismatchError
}) => {

    return (
        <form>

            <h1 class="thin h1-space">Create a strong password</h1>

            <h2 class='thin gap center'>Create a strong password with a mix of letters, numbers and symbols</h2>

            <label class="space line-height label-input-width input-label">
                <input 
                    class="input"
                    type='password' 
                    value={password} 
                    onChange={(e) => setPassword(e.target.value)} 
                    placeholder={passwordPlaceholder}
                    onFocus={handlePasswordClick}
                    onBlur={handlePasswordBlur}
                />
            </label>
     
            <label class="space line-height label-input-width input-label" id='error-message-margin'>
                <input 
                    class="input"
                    type='password'
                    value={confirmPassword}
                    onChange={(e) => setConfirmPassword(e.target.value)} 
                    placeholder={confirmPlaceholder}
                    onFocus={handleConfirmClick}
                    onBlur={handleConfirmBlur}
                />
            </label>

            {passwordMismatchError && 
                <div class='line-height label-input-width input-label'>
                    <p className="input-error-message">Those passwords didnâ€™t match. Try again.</p>
                </div>}
            
            <div class='button-right'>
                <button class="button-space blue-button" type="button" onClick={handleNextClick}>
                    Next   
                </button>
            </div>

        </form>
    );
}
